if (pctMove > 0.3) bearScore += 1;  // overbought drop

log("ðŸ“Š Bull: " + bullScore + " | Bear: " + bearScore + " | RSI: " + r.toFixed(1) + " | Vol: " + (volSpike ? "ðŸ”¥SPIKE" : "normal"));

// â”€â”€â”€ Execute trades â”€â”€â”€
