if (crossover(fast, mid) && r < 55 && r14 < 50) go = "buy"
if (crossunder(fast, mid) && r > 45 && r14 > 50) go = "sell"

// BB SQUEEZE + momentum
if (price < bands.lower && momentum5 < -0.15) go = "buy"
